import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import espressoImg from "./assets/espresso.png";
import refresherImg from "./assets/refreshercoffee.png";
import teaImg from "./assets/teacoffee.png";
import blendedImg from "./assets/chocolate.png";
import pastryImg from "./assets/pastry.png";
import CartIcon from "./CartIcon";
import "./App.css";

export default function CoffeeShop({ addToCart, totalItems }) {
  const navigate = useNavigate();
  const [hovered, setHovered] = useState(null); // <-- Hover state here

  const buttonStyle = {
    border: "2px solid #6f4e37",
    width: "140px",
    height: "240px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    cursor: "pointer",
    background: "#f3e9dc",
    textAlign: "center",
    borderRadius: "12px",
    boxShadow: "4px 4px 8px rgba(111, 78, 55, 0.3)",
    transition: "transform 0.2s ease, box-shadow 0.2s ease",
  };

  const buttonHoverStyle = {
    transform: "scale(1.05)",
    boxShadow: "6px 6px 12px rgba(111, 78, 55, 0.6)",
  };

  const imgStyle = {
    width: "120px",
    height: "auto",
    borderRadius: "12px",
    objectFit: "cover",
    boxShadow: "2px 2px 6px rgba(111, 78, 55, 0.5)",
  };

  const labelStyle = {
    fontFamily: "'Sansita Swashed', cursive",
    marginTop: "15px",
    color: "#6f4e37",
    fontWeight: "700",
    fontSize: "1.1rem",
    background: "#d6bfa6",
    borderRadius: "8px",
    padding: "8px 12px",
    width: "100%",
    border: "2px solid #6f4e37",
    boxShadow: "inset 0 0 5px rgba(111, 78, 55, 0.2)",
  };

  const backButtonStyle = {
    fontSize: "1.7rem",
    cursor: "pointer",
    background: "#6f4e37",
    border: "none",
    borderRadius: "50%",
    width: "55px",
    height: "55px",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    color: "#fff",
    boxShadow: "2px 2px 6px rgba(111, 78, 55, 0.6)",
    transition: "background-color 0.3s ease",
  };

  const backButtonHoverStyle = {
    backgroundColor: "#5a3f2d",
  };

  return (
    <div
      style={{
        textAlign: "center",
        fontFamily: "'Roboto', sans-serif",
        backgroundColor: "#fff7f0",
        minHeight: "100vh",
        padding: "1rem 0 3rem",
      }}
    >
      {/* Container for back button + cart icon */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
          gap: "12px",
          width: "100%",
          maxWidth: "820px",
          margin: "0 auto 1.5rem auto",
          padding: "0 1.5rem",
          position: "relative",
        }}
      >
        {/* Back Home Button */}
        <button
          onClick={() => navigate("/")}
          style={backButtonStyle}
          aria-label="Back to Home"
          title="Back to Home"
          onMouseEnter={(e) =>
            (e.currentTarget.style.backgroundColor = backButtonHoverStyle.backgroundColor)
          }
          onMouseLeave={(e) =>
            (e.currentTarget.style.backgroundColor = backButtonStyle.background)
          }
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="28"
            height="28"
            fill="none"
            stroke="currentColor"
            strokeWidth="3"
            strokeLinecap="round"
            strokeLinejoin="round"
            viewBox="0 0 24 24"
          >
            <polyline points="15 18 9 12 15 6" />
          </svg>
        </button>

        {/* Cart Icon */}
        <CartIcon totalItems={totalItems} />
      </div>

      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(3, 1fr)",
          gap: "2rem",
          maxWidth: "600px",
          margin: "auto",
          paddingBottom: "3rem",
        }}
      >
        {[
          {
            key: "espresso",
            img: espressoImg,
            label: "Espresso",
            nav: "/espresso",
          },
          {
            key: "refresher",
            img: refresherImg,
            label: "Refresher",
            nav: "/refresher",
          },
          {
            key: "tea",
            img: teaImg,
            label: "Tea",
            nav: "/tea",
          },
          {
            key: "blended",
            img: blendedImg,
            label: "Blended Beverage",
            nav: "/blended",
          },
          {
            key: "pastry",
            img: pastryImg,
            label: "Pastry",
            nav: "/pastry",
          },
        ].map(({ key, img, label, nav }) => (
          <button
            key={key}
            onClick={() => navigate(nav)}
            style={{
              ...buttonStyle,
              ...(hovered === key ? buttonHoverStyle : {}),
            }}
            onMouseEnter={() => setHovered(key)}
            onMouseLeave={() => setHovered(null)}
            aria-label={label}
          >
            <img src={img} alt={label} style={imgStyle} />
            <div style={labelStyle}>{label}</div>
          </button>
        ))}
      </div>
    </div>
  );
}
